import { NavLink } from 'react-router-dom'
import s from './Dialogs.module.css'



const DialogItem = (props) => {
    let path = '/dialogs/' + props.id;
    return (
        <div className={s.item}>
            <NavLink to={path}>{props.name}</NavLink>
        </div>
    )
}

const Message = (props) => {
    return (
        <div className={s.message}>{props.message}</div>
    )
}

const Dialogs = (props) => {
    let dialogsData = [
    {name: "Diman", id: 1},
    {name: "Roman", id: 2},
    {name: "Samochka olga", id: 3},
    {name: "Serdey", id: 4},
    {name: "No name hero", id: 5},
    ]

    let messageData = [
        {id: 1, message: 'Hello!'},
        {id: 2, message: 'apolinapolis, its realy you?!'},
        {id: 3, message: 'i`m youre friend to!'},
        {id: 4, message: 'WAZZZZAP!'},
        {id: 5, message: 'Ohh... its Grossartich!'},
    ]

    let dialogsElements = [
        <DialogItem name={dialogsData[0].name} id={dialogsData[0].id} />,
        <DialogItem name={dialogsData[1].name} id={dialogsData[1].id} />,
        <DialogItem name={dialogsData[2].name} id={dialogsData[2].id} />,
        <DialogItem name={dialogsData[3].name} id={dialogsData[3].id} />,
        <DialogItem name={dialogsData[4].name} id={dialogsData[4].id} />,
    ]

    return (
        <div className={s.dialogs}>
            <div className={s.dialogsItems}>
            {dialogsElements}
            </div>
            <div className={s.messages}>
                <Message className={s.message} message = {messageData[0].message}/>
                <Message className={s.message} message = {messageData[1].message}/>
                <Message className={s.message} message = {messageData[2].message}/>
                <Message className={s.message} message = {messageData[3].message}/>
                <Message className={s.message} message = {messageData[4].message}/>
            </div>
        </div>
    )

}

export default Dialogs
